import styles from '../../styles/playlist.module.css';

const Unfound = ({ songs }) => {

  return (
    <div className={styles.unfound}>
      <h3>We were unable to find { songs.length } from the chosen setlist on Spotify. The song names are:</h3>
      <div>
        { songs.map((song, i) => (
          <span key={i}>{ song }</span>
        ))}
      </div>
    </div>
  )
}

export default Unfound
